import React from "react";
import context from "./context";
export default function FindUser() {
  const search = React.useContext(context);
  const formIs = (
    <form>
      {" "}
      <input
        type="text"
        id="userName"
        placeholder="search user"
        onSubmit={search}
      />
    </form>
  );

  return <React.Fragment>{formIs}</React.Fragment>;
}
